// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.25 <0.9.0;
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

import "./LicenseTools.sol";
import "./LicenseToken.sol";
import "./ServiceManager.sol";
import "./BlockchainManager.sol";
import "./BlockchainUserCenter.sol";

contract UserMonitoringCenter is AccessControl {
    using EnumerableSet for EnumerableSet.UintSet;

    /******************************
        EVENTS
    ******************************/
    event BlockchainUsersContractCreated(address contractAddress);

 
    /******************************
        VARIABLES
    ******************************/

    bytes32 constant OWNER_ROLE = keccak256("OWNER_ROLE");
    bytes32 constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    // manager of the contract
    address private _owner;
    // manager owner address
    address private _managerOwner;


    // _users Contract Address set
    mapping(uint => address) _blockchainUsersContractAddresses;

    // Declare a set state variable of registered blockchains ids
    EnumerableSet.UintSet _blockchainIds;

    address blockchainUserCenterImplementation;

    //Service Manager
    address serviceManagerInstanceAdd;
    //License Manager
    address licenseTokenInstanceAdd;
    //License Manager
    address blockchainInstanceAdd;
    
    //License Manager
    LicenseToken licenseTokenInstance;
    //blockchain Manager
    BlockchainManager blockchainManagerInstance;

    uint256 private _openReadingPool;

    bool private initialized;
    bool _isActive = true;

    modifier checkActive() {
        require(_isActive, "INACTV");
        _;
    }

    /**
     * @notice initialize function
     * @param userAddress user address
     * @param managementCenterOwnerAddress  owner of the management center
     * @param serviceManagerAddress  service Manager Address
     * @param licenseTokenAddress license Token Address
     * @param blockchainManagerAddress license Token Address
     */
    function initialize(
        address managementCenterOwnerAddress,
        address userAddress,
        address serviceManagerAddress,
        address licenseTokenAddress,
        address blockchainManagerAddress
    ) public {
        require(!initialized, "Contract instance has already been initialized");
        _managerOwner = managementCenterOwnerAddress;
        _owner = userAddress;
        _setupRole(OWNER_ROLE, _owner);
        _setupRole(MANAGER_ROLE, _managerOwner);
        serviceManagerInstanceAdd = serviceManagerAddress;
        licenseTokenInstanceAdd = licenseTokenAddress;
        blockchainInstanceAdd = blockchainManagerAddress;
        licenseTokenInstance = LicenseToken(licenseTokenAddress);
        blockchainManagerInstance = BlockchainManager(blockchainManagerAddress);
        blockchainUserCenterImplementation = address(new BlockchainUserCenter());
        initialized = true;
        _isActive = true;
    }

    /**
     * @notice change manager
     * @dev function is created in case of management center replacement
     * @param newManagementCenterAddress manager Transaction Feed
     */
    function transferManagement(address newManagementCenterAddress) public {
        require(
            // Only manager's owner can change manager
            _managerOwner == _msgSender(),
            "UNAUTH"
        );
        _managerOwner = newManagementCenterAddress;
    }    

    /**
     * @notice change manager
     * @dev function is created in case of management center replacement
     * @param isActive isActive variable
     */
    function setActivity(bool isActive) public {
        require(hasRole(MANAGER_ROLE, _msgSender()),
            "UNAUTH"
        );
        _isActive = isActive;
    }


    /**
     * @notice set open reading services pool
     * @param openReadingPool open Reading Status
     */
    function setOpenReadingServicePool(uint256 openReadingPool)
        public
        checkActive
    {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        _openReadingPool = openReadingPool;
    }

    /**
     * @notice get open reading services pool
     */
    function getOpenReadingServicePool()
        public
        view
        checkActive
        returns (uint256)
    {
        return _openReadingPool;
    }

    /**
     * @notice get open reading
     * @param serviceId service
     * @return openReadingStatus
     */
    function isOpenReadingService(uint256 serviceId)
        public
        view
        checkActive
        returns (bool)
    {
        return LicenseTools.getBoolean(_openReadingPool, serviceId);
    }


    /**
     * @notice Verify an address
     * @param blockchainId blockchain Id
     */
    function registerBlockchain(uint blockchainId)
        public
        checkActive
        returns (address)
    {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        require(blockchainManagerInstance.existBlockchain(blockchainId) , "UFNDBK");
        require(_blockchainUsersContractAddresses[blockchainId] == address(0), "FND");
        address clone = Clones.clone(blockchainUserCenterImplementation);
        BlockchainUserCenter(clone).initialize(
            address(this),
            _managerOwner,
            _msgSender(),
            serviceManagerInstanceAdd,
            licenseTokenInstanceAdd,
            blockchainId
        );
        _blockchainUsersContractAddresses[blockchainId] = clone;
        _blockchainIds.add(blockchainId);
        emit BlockchainUsersContractCreated(_blockchainUsersContractAddresses[blockchainId]);
        return clone;
    }    


    /**
     * @notice get User Contract Address
     */
    function getBlockchainManagerContractAddress(uint blockchainId) public view returns (address) {
        return _blockchainUsersContractAddresses[blockchainId];
    }

    /**
    * @notice get all blockchain contracts.
    * Return the entire set in an array
    //
    // WARNING	This operation will copy the entire storage to memory,
    // which can be quite expensive. This is designed to mostly be used by view
    // accessors that are queried without any gas fees.
    // Developers should keep in mind that this function
    // has an unbounded cost, and using it as part of a state-changing
    // function may render the function uncallable if the set grows to a
    // point where copying to memory consumes too much gas to fit in a block.
    */
    function getAllRegisteredBlockchainIds()
        public
        view
        checkActive
        returns (uint[] memory)
    {
        return _blockchainIds.values();
    }    

}

